INSERT INTO [dbo].[LocalizedStrings] ([ID], [BaseResourceKey], [UICulture], [Translation], [LiveTranslation], [Status], [StringResource_ID]) VALUES (838, 210, N'en', N'Enables Pointer lock.  Pointer lock provides input methods based on the movement of the mouse over time, not just the absolute position of the mouse cursor. Pointer lock is useful for applications that require significant mouse input to control movements, rotate objects, and change entries. It is particularly essential for highly visual applications, such as those that use first-person perspective, as well as 3D views and modeling. By default, sandboxed iframes block Pointer lock. ', N'Enables Pointer lock.  Pointer lock provides input methods based on the movement of the mouse over time, not just the absolute position of the mouse cursor. Pointer lock is useful for applications that require significant mouse input to control movements, rotate objects, and change entries. It is particularly essential for highly visual applications, such as those that use first-person perspective, as well as 3D views and modeling. By default, sandboxed iframes block Pointer lock. ', 3, 210)
INSERT INTO [dbo].[LocalizedStrings] ([ID], [BaseResourceKey], [UICulture], [Translation], [LiveTranslation], [Status], [StringResource_ID]) VALUES (839, 210, N'de', N'Aktiviert den Pointer Lock. Pointer Lock erlaubt eingabemethoden welche auf Mausbewegungen über eine Zeitspanne basieren. Pointer Lock ist für Seiten welche Mausinput benötigen um Objekte zu rotieren oder Einträge zu ändern wichtig. Das ist besonders für hoch visuelle Applikationen wichtig, welche zum Beispiel First-Person Perspektiven anbieten, 3D Models darstellen oder das Modelling ermöglichen. Standardmäßig ist Pointer Lock in IFrames deaktiviert.', N'Aktiviert den Pointer Lock. Pointer Lock erlaubt eingabemethoden welche auf Mausbewegungen über eine Zeitspanne basieren. Pointer Lock ist für Seiten welche Mausinput benötigen um Objekte zu rotieren oder Einträge zu ändern wichtig. Das ist besonders für hoch visuelle Applikationen wichtig, welche zum Beispiel First-Person Perspektiven anbieten, 3D Models darstellen oder das Modelling ermöglichen. Standardmäßig ist Pointer Lock in IFrames deaktiviert.', 3, 210)
INSERT INTO [dbo].[LocalizedStrings] ([ID], [BaseResourceKey], [UICulture], [Translation], [LiveTranslation], [Status], [StringResource_ID]) VALUES (840, 210, N'pl', N'nt', N'nt', 0, 210)
