INSERT INTO [dbo].[LocalizedStrings] ([ID], [BaseResourceKey], [UICulture], [Translation], [LiveTranslation], [Status], [StringResource_ID]) VALUES (842, 211, N'en', N'Allows the content to be treated as being from its normal origin. Without this token, the content is forced into a unique origin, thus preventing it from accessing other content from the same origin. Also, without the allow-same-origin token, scripts are prevented from reading from or writing to the document.cookie IDL attribute, and blocks access to localStorage and openDatabase(). [WEBSTORAGE] [WEBSQL].', N'Allows the content to be treated as being from its normal origin. Without this token, the content is forced into a unique origin, thus preventing it from accessing other content from the same origin. Also, without the allow-same-origin token, scripts are prevented from reading from or writing to the document.cookie IDL attribute, and blocks access to localStorage and openDatabase(). [WEBSTORAGE] [WEBSQL].', 3, 211)
INSERT INTO [dbo].[LocalizedStrings] ([ID], [BaseResourceKey], [UICulture], [Translation], [LiveTranslation], [Status], [StringResource_ID]) VALUES (843, 211, N'de', N'Erlaubt dem inhalt so behandelt zu werden als ob es normal in dieser Seite eingebettet ist. Ohne diese Option können eingebettete Inhalte nicht auf diese Seite zugreifen.', N'Erlaubt dem inhalt so behandelt zu werden als ob es normal in dieser Seite eingebettet ist. Ohne diese Option können eingebettete Inhalte nicht auf diese Seite zugreifen.', 3, 211)
